export function ControllableParameters(){
	return [
		{"property":"shutdownColor", "label":"Shutdown Color","min":"0","max":"360","type":"color","default":"009bde"},
		{"property":"LightingMode", "label":"Lighting Mode", "type":"combobox", "values":["Canvas","Forced"], "default":"Canvas"},
		{"property":"forcedColor", "label":"Forced Color","min":"0","max":"360","type":"color","default":"009bde"},
	];
}

const DeviceMaxLedLimit = 1000;
var ChannelArray = [
	["Channel 1", 1000],
];

function SetupChannels()
{
	device.SetLedLimit(DeviceMaxLedLimit);
	for(let i = 0; i < ChannelArray.length; i++)
	{
		device.addChannel(ChannelArray[i][0],ChannelArray[i][1]);
	}
}

const vKeyNames = [];
const vKeyPositions = [];
const MaxLedsInPacket = 20;

export function LedNames()
{
	return vKeyNames;
}

export function LedPositions()
{
	return vKeyPositions;
}

export function Initialize()
{
	var packet = new Array(65).fill(0);
	packet[2] = 0x01;
	device.write(packet, 65);
	SetupChannels()
}

export function Shutdown()
{
	SendChannel(0, true);
	device.pause(10);
}

function SendChannel(Channel,shutdown = false)
{
	var ChannelLedCount = device.channel(ChannelArray[Channel][0]).ledCount;

	var RGBData = [];
	if(shutdown)
	{
		RGBData = device.createColorArray(shutdownColor, ChannelLedCount, "Inline");
	}
	else if(LightingMode == "Forced")
	{
		RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline");
	}
	else if(device.getLedCount() == 0)
	{
		ChannelLedCount = 90;
		var pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
		RGBData = device.createColorArray(pulseColor, ChannelLedCount, "Inline");
	}
	else
	{
		RGBData = device.channel(ChannelArray[Channel][0]).getColors("Inline");
	}
	
	var NumPackets = Math.ceil(ChannelLedCount / MaxLedsInPacket);
	
	for(var CurrPacket = 1; CurrPacket <= NumPackets; CurrPacket++)
	{
		var packet = [];
		packet[0] = 0x00;
		packet[1] = CurrPacket;
		packet[2] = 0x00;
		packet[3] = NumPackets;
		packet[4] = 0x00;
		packet = packet.concat(RGBData.splice(0,60));
		device.write(packet, 65);
	}
}

export function Render()
{
	SendChannel(0);
	device.pause(10);
}

export function Validate(endpoint)
{
	return endpoint.interface === 2;
}

